script: |
  super -f text -I q13266.spq | sort > q13266.out

inputs:
  - name: q13266.spq
    data: |
      SELECT DISTINCT + ( + col0 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( - col2 * - ( - col1 ) + + col2 ) NOT IN ( col0 * + col2 ) AND NOT + col1 + + col0 * - col2 IS NULL;
  - name: tab1

outputs:
  - name: q13266.out
    data: |
